// Funcin para renderizar texto
void renderTextH(const char* text, float x, float y) {
    glRasterPos2f(x, y);
    for (const char* c = text; *c != '\0'; c++) {
        glutBitmapCharacter(GLUT_BITMAP_HELVETICA_18, *c);
    }
}
// Funcin para renderizar la historia
void renderHistory() {
    glColor3f(0.0f, 0.0f, 0.0f);
    renderTextH("HISTORIA DEL JUEGO", 400, 600);
    renderTextH("El juego narra la historia de Isaac, un nino que vive con su madre. Ella,", 250, 500);
    renderTextH("influenciada por una voz que escucha desde el atico, recibe instrucciones de", 250, 480);
    renderTextH("'purificar' a su hijo del pecado. Como parte de este mandato, le quita sus,", 250, 460);
    renderTextH("dibujos, juguetes y ropa. Mas tarde, la voz le ordena aislar a Isaac de todo lo,", 250, 440);
    renderTextH("malo del mundo, encerrandolo en su habitacion. Finalmente, la voz exige el ", 250, 420);
    renderTextH("sacrificio de Isaac. Dispuesta a cumplir, su madre intenta matarlo, pero Isaac ", 250, 400);
    renderTextH("encuentra una trampilla oculta bajo su alfombra que lo lleva al sotano. Alli, se", 250, 380);
    renderTextH("enfrenta a terrorificos monstruos que lo atacan, y debera usar sus lagrimas de", 250, 360);
    renderTextH("tristeza como proyectiles para defenderse y sobrevivir.", 250, 340);
    renderTextH("Presiona ESC para volver al menu...", 50, 50);
}

